Here is the function to invoke:


[
  {
    // Convert time from one time zone to another.
    function_name: 'timezone.convert' or null,
    // The local time you want to convert, e.g. 3pm
    time: string,
    // The time zone you want to convert from.
    from_timezone: string,
    // The time zone you want to convert to.
    to_timezone: string,
  } or {
    // Calculate potential greenhouse gas emissions saved by switching to renewable energy sources.
    function_name: 'calculate_emission_savings' or null,
    // Type of the renewable energy source.
    energy_type: string,
    // Usage duration in months.
    usage_duration: int,
    // The region where you use energy. Default is 'global'.
    region: string or null,
  }
]


